    const { life, love, passion, hobby } = useContext(DataContext).about

    return (
        <Fragment>
            <h1>Zuber's life</h1>
        </Fragment>
    )
}

About.propTypes = {
    life: PropTypes.shape({}).isRequired,
    love: PropTypes.shape({}).isRequired,
    passion: PropTypes.shape({}).isRequired,
    hobby: PropTypes.shape({}).isRequired,
}

export default About

